import React from 'react';
import './ModelDetails.css';

const ModelDetails = ({ model, onDeselect, onContinue }) => {
  const attributes = Object.entries(model.additionalAttribute || {});

  return (
    <div className="model-details">
      <h3>Detalles del Modelo: {model.name}</h3>
      <div className="grid-container">
        {attributes.map(([key, value], index) => (
          <div key={index} className="card attribute-card">
            <h4>{key}</h4>
            <p>{value}</p>
          </div>
        ))}
      </div>
      <button onClick={onDeselect}>Deseleccionar Modelo</button>
      <button onClick={onContinue}>Continuar</button>
    </div>
  );
};

export default ModelDetails;
